import React , {useState, useEffect} from 'react';
import { PortfolioSection, PortfolioTitle, Span, PortfolioList, PortfolioItem, ImageWrapper, Image, Overlay, OverlaySpan  } from "./style";

const Portfolio = () => {


    const [images, setImages] = useState([]);

    useEffect(() => {
        Axios.get('js/data.json').then
    }, []);

    return (
        <PortfolioSection>
            <PortfolioTitle><Span>Mon</Span> Portfolio</PortfolioTitle>
            <PortfolioList>
                <PortfolioItem active>Tout</PortfolioItem>
                <PortfolioItem>HTML</PortfolioItem>
                <PortfolioItem>Photoshop</PortfolioItem>
                <PortfolioItem>Wordpress</PortfolioItem>
                <PortfolioItem>Mobile</PortfolioItem>
            </PortfolioList>

            <div className="box">

                <ImageWrapper>
                    <Image src="images/Portfolio/portfolio-img1.jpg" alt="" />
                    <Overlay>
                        <OverlaySpan>
                        Afficher l'image
                        </OverlaySpan>
                    </Overlay>
                </ImageWrapper>                

            </div>

        </PortfolioSection>
    );
}




export default Portfolio;
